const calculatedHashes = [];

async function calculateHashes() {
    const fileInput = document.getElementById('fileInput');
    const hashResults = document.getElementById('hashResults');
    
    if (fileInput.files.length === 0) {
        alert('Por favor, selecciona al menos un archivo para calcular los hashes.');
        return;
    }

    showWarningModal();

    await new Promise(resolve => {
        const modalButton = document.querySelector('#warningModal button');
        modalButton.addEventListener('click', () => {
            closeWarningModal();
            showLoadingModal();
            resolve();
        });
    });

    for (const file of fileInput.files) {
        const reader = new FileReader();
        
        await new Promise(resolve => {
            reader.onload = async function(event) {
                const dataBuffer = event.target.result;
                const hashBuffer = await crypto.subtle.digest('SHA-1', dataBuffer);
                const hashArray = Array.from(new Uint8Array(hashBuffer));
                const hashHex = hashArray.map(byte => byte.toString(16).padStart(2, '0')).join('');
                const fileInfo = {
                    filename: file.name,
                    hash: hashHex
                };

                calculatedHashes.push(fileInfo);

                const resultElement = document.createElement('div');
                resultElement.classList.add('result');
                resultElement.innerHTML = `
                    <p><b>Nombre de archivo (.ext):</b> ${fileInfo.filename}</p>
                    <p><span style="color: #007bff;"><b>Hash SHA-1:</b> ${fileInfo.hash}</span></p>
                `;
                hashResults.appendChild(resultElement);
                resolve();
            };

            reader.readAsArrayBuffer(file);
        });
    }

    closeLoadingModal();
    showSuccessModal();
}

function showWarningModal() {
    document.getElementById('warningModal').style.display = 'block';
}

function closeWarningModal() {
    document.getElementById('warningModal').style.display = 'none';
}

function showLoadingModal() {
    document.getElementById('loadingModal').style.display = 'block';
}

function closeLoadingModal() {
    document.getElementById('loadingModal').style.display = 'none';
}

function showSuccessModal() {
    document.getElementById('successModal').style.display = 'block';
}

function closeModal() {
    document.getElementById('successModal').style.display = 'none';
}

function downloadResults() {
    if (calculatedHashes.length === 0) {
        alert('No hay ningún reporte para descargar.');
        return;
    }

    const currentDateArgentina = new Date();
    const formattedDate = currentDateArgentina.toLocaleDateString();
    const formattedTime = currentDateArgentina.toLocaleTimeString();

    let resultsHTML = `<html lang="es">
    <head>
        <meta charset="UTF-8">
        <meta name="author" content="Miguel Santiago Kremzky (Auditor/Técnico/Programador en Redes y Sistemas Informáticos - Perito en Informática Forense - Especialista en Ciberseguridad) :)">
        <title>Reporte Hash SHA-1</title>
	        <link rel="shortcut icon" href="data:image/png;base64,">
        <style>
            @page {
                size: A4;
            }

            body {
                margin-top: 15mm;
                margin-left: 15mm;
                margin-right: 15mm;
                margin-bottom: 15mm;
                font-family: Arial, sans-serif;
            }

            h1 {
                text-align: center;
                margin-top: 2px;
                margin-bottom: 0;
            }

            .line {
                border-top: 1px solid black;
                width: 900px;
                margin: 5px auto;
            }

            strong {
                text-align: center;
                display: block;
                margin-bottom: 2px;
                font-size: 14px;
            }

            .logo {
                width: 43%;
                max-width: 43px;
                margin: 0 auto;
		        margin-top: -50px;
                display: block;
            }

        </style>
    </head>
    <body>
        <img class="logo" src="data:image/png;base64," alt="Escudo Policía de Entre Ríos">
        <div class="container">
            <strong>POLICÍA DE ENTRE RÍOS</strong>
            <strong>Calculadora Algorítmica SHA+, versión 2.6.7</strong>
        </div>
        <div class="line"></div>
        <h1>REPORTE HASH SHA-1</h1>
		<p style="text-align: left; margin-top: 0; margin-bottom: 1px;"><b>Reporte Nº:</b> .......... <b>/</b> ..........</p>
        <div style="text-align: left; margin-bottom: 2px;"><b>Fecha y Hora de creación:</b> ${formattedDate} - ${formattedTime}.</div>
        <div class="line"></p>
        <ol>`;

    calculatedHashes.forEach(item => {
        resultsHTML += `
        <li>
            <b>Nombre de archivo (.ext):</b> ${item.filename}<br>
            <b>Hash SHA-1:</b> ${item.hash}<br><br>
        </li>`;
    });

    resultsHTML += `
        </ol>
    </body>
    </html>`;

    const blob = new Blob([resultsHTML], { type: 'text/html' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'Reporte Hash SHA-1.html';
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
}

function clearResults() {
    const hashResults = document.getElementById('hashResults');
    hashResults.innerHTML = '';
    calculatedHashes.length = 0;
    const fileInput = document.getElementById('fileInput');
    fileInput.value = '';
}
